import React from "react";
import Bar from "@cvccorp-components/icons/dist/Bar";
import Parking from "@cvccorp-components/icons/dist/Parking";
import { Paper, Divider, } from "@material-ui/core";
import { makeStyles , MuiThemeProvider } from "@material-ui/core/styles";
import Typography from "@material-ui/core/Typography";
import { Wifi, Gym, Pool } from "@material-ui/icons";
import { storiesOf } from "@storybook/react";
import themes from "../../../Theme/themes";
import { BrandType } from "../../../types/brand";
import ResultItemPackage from "../ResultItem";

const useStyles = makeStyles((theme) => ({
    root: {
        background: theme.palette.background.default,
        boxShadow: theme.shadows[8],
        padding: "30px",
    },
    darkBg: {
        background: "rgba(0, 0, 0, 0.6)",
        boxShadow: theme.shadows[8],
        padding: "30px",
    },
}));

type PackageStoryProps = {
    mode: string,
    brand: BrandType,
    title: string,
    subtitle: string,
    stars: number,
    totalPrice: string,
    taxesIncluded: boolean,
    parcel: string,
    lastItem: string, 
    meal: string,
    rate: string,
    totalAvaliations: string,
    discount: string,
    partialPrice: string,
    totalPeople: string,
    totalDays: string
}

const PackageStory = ({
    mode, 
    brand,
    title, 
    subtitle, 
    stars, 
    totalPrice,
    taxesIncluded, 
    parcel,
    lastItem, 
    meal,
    rate,
    totalAvaliations,
    discount,
    partialPrice,
    totalPeople,
    totalDays
}: PackageStoryProps) => {
    const classes = useStyles(themes[brand]);

    return (
        <MuiThemeProvider theme={themes[brand]}>
            <Paper className={classes[mode]} id="Package">
                <Typography variant="h3">Package</Typography>
                <br />
                <Divider />
                <br />
                <ResultItemPackage
                    onClick={() => { } }
                    type="list"
                    notAvaliable
                    cloudinarySettings="e_trim/w_400,ar_1:1,c_fill,g_auto/e_sharpen/q_auto,f_auto,fl_lossy"
                    onFav={() => { } }
                    isFavorite
                    title={title}
                    subtitle={subtitle}
                    stars={stars}
                    partialPrice={partialPrice}
                    totalPrice={totalPrice}
                    taxesIncluded={taxesIncluded}
                    parcelInfo={parcel}
                    totalDays={totalDays}
                    totalAvaliations={totalAvaliations}
                    rate={rate}
                    discount={discount}
                    luggage={{ carryOn: true, checkedBag: true, handBag: true }} 
                    isActive
                    lastItem={lastItem}
                    className={{}} 
                    meal={meal}
                    stops
                    departure="departure"
                    arrival={undefined}
                    totalPeople={totalPeople}
                    id="1"
                />
            </Paper>
        </MuiThemeProvider>

    );
};

const argsControls = {
    args: {
        brand: "CVC",
        mode: "root",
        title: "Item 2",
        subtitle: "Subtitle 2",
        stars: 3,
        totalPrice: "100",
        taxesIncluded: true,
        parcel: "Parcele sua viagem",
        lastItem: "3", 
        meal: "meal",
        rate: "10",
        totalAvaliations: "9",
        discount: "50",
        partialPrice: "40",
        totalPeople: "2",
        totalDays: "9",
    },
    argTypes: {
        brand: {
            type: "select",
            options: ["BlackAndWhite", "BlackFriday", "CVC", "CVCCorp", "CVCYellow", "Sub"]
        },
        mode: {
            type: "select",
            options: ["root", "darkBg"]
        },
        title: { type: "string" },
        subtitle: { type: "string" },
        stars: { type: "number" },
        totalPrice: { type: "string" },
        taxesIncluded: { type: "boolean" },
        parcel: { type: "string" },
        lastItem: { type: "string" },
        meal: { type: "string" },
        rate: { type: "string" },
        totalAvaliations: { type: "string" },
        discount: { type: "string" },
        partialPrice: { type: "string" },
        totalPeople: { type: "string" },
        totalDays: { type: "string" },
    }
}

storiesOf("Components/ResultItem/Package", module).addParameters({ storySource: { source: __STORY__, locationsMap: __LOCATIONS_MAP__ } })
    .add("Default", (args) => <PackageStory {...args}/>, argsControls);
